import React, { useState, useEffect } from 'react';

const Admin = () => {

  // Fetch DB JSON
  const [users, setUsers] = useState([]);

  useEffect(() => {
    const fetchUsers = async () => {
      try {
        const response = await fetch('http://localhost:3500/users'); // Replace with the actual API route for fetching users
        if (response.ok) {
          const data = await response.json();
          setUsers(data);
        } else {
          console.error('Failed to fetch users');
        }
      } catch (error) {
        console.error('Error:', error);
      }
    };

    fetchUsers();
  }, []);

  // Filters
  const [nameFilter, setNamelFilter] = useState(null);
  const [usernameFilter, setUsernameFilter] = useState(null);
  const [statusFilter, setStatusFilter] = useState(null);

  // Filters
  const handleNameFilterChange = (event) => {
    setNamelFilter(event.target.value);
    };
  const handleUsernameFilterChange = (event) => {
    setUsernameFilter(event.target.value);
    };
  const handleStatusFilterChange = (event) => {
    setStatusFilter(event.target.value);
    };

  return (
    <div className='admin-wrapper'>

<aside className="filters">
            <h3>Filters</h3>
            <div className="filters-wrapper">
                <div className='filter-container'>
                  <label><b>Platform:</b> </label>
                  <select onChange={handleSocialFilterChange}>
                    <option value="">All</option>
                    <option value="TikTok">TikTok</option>
                    <option value="IG">IG</option>
                    <option value="Pinterest">Pinterest</option>
                  </select>
                </div>
                <div className='filter-container'>
                  <label><b>Date:</b> </label>
                  <select onChange={handleDateFilterChange}>
                    <option value="">All</option>
                    <option value="today">Today</option>
                    <option value="this_week">This Week</option>
                    <option value="this_month">This Month</option>
                  </select>
                </div>
                <div className='filter-container'>
                  <label> <b>Type:</b> </label>
                  <select onChange={handleTypeFilterChange}>
                    <option value="">All</option>
                    <option value="post">Post</option>
                    <option value="story">Story</option>
                  </select>
                </div>
                <div className='filter-container'>
                  <label><b>Words:</b></label>
                  <input type="text" onChange={handleTextFilterChange} placeholder='Type any word'/>
                </div>
            </div>
          </aside>


      <h1>User List</h1>
      {users.map((user) => (
        <div key={user.id}>
          <p>Name: {user.name}</p>
          <p>Username: {user.username}</p>
          <p>Status: {user.status}</p>
          <hr />
        </div>
      ))}
    </div>
  );
};

export default Admin;
